import React from "react";
import { NavLink } from "react-router-dom";

const Suggestions = props => {
  const options = props.results.map(res => (
    <li>
      <NavLink className="pl-0" key={res.id} exact to={"/sak/" + res.sak_id}>
        <a className="text-uppercase dropdown-item t">{res.overskrift}</a>
      </NavLink>
    </li>
  ));

  return <ul style={{ padding: "0", listStyleType: "none" }}>{options}</ul>;
};
export default Suggestions;
